apiVersion: v1
kind: ConfigMap
metadata:
  name: traefik-helper-config
data:
  index.html: |-
    <!DOCTYPE html>
    <html>
    <head>
      <title>IEEE-TAMU</title>
      <style>
        html {
          color-scheme: light dark;
        }
        body {
          width: 35em;
          margin: 0 auto;
          font-family: Tahoma, Verdana, Arial, sans-serif;
        }
      </style>
    </head>
    <body>
      <h1>IEEE-TAMU</h1>
      <h2 id='service'></h2>
      <p id='message'>Oops, the page you are looking for doesn't exist</p>
      <p id='visit'>Try visiting the official <a href="https://ieeetamu.org">IEEE TAMU page</a> to find what you're looking for.</p>
      <p id='conference'>Looking for the conference? Visit <a href="https://conference.ieee-tamu.org">here</a>.</p>
    </body>
    <script>
      var subdomain = window.location.host.split('.')[0]
      document.getElementById('service').innerHTML = subdomain;
    </script>
    </html>
  favicon.svg: |
    <svg width="20" height="20" xmlns="http://www.w3.org/2000/svg">
      <style>
        circle { fill: white; }
        polygon { fill: black; }
        @media (prefers-color-scheme: dark) {
          circle { fill: black; }
          polygon { fill: white; }
        }
      </style>
      <circle cx="10" cy="10" r="10"/>
      <polygon points="13,4 7,10 9,10"/>
      <polygon points="13,10 11,10 7,16"/>
    </svg>
  site.webmanifest: |
    {
      "name": "IEEE-TAMU",
      "short_name": "IEEE",
      "icons": [
        {
          "src": "/web-app-manifest-192x192.png",
          "sizes": "192x192",
          "type": "image/png",
          "purpose": "maskable"
        },
        {
          "src": "/web-app-manifest-512x512.png",
          "sizes": "512x512",
          "type": "image/png",
          "purpose": "maskable"
        }
      ],
      "theme_color": "#ffffff",
      "background_color": "#ffffff",
      "display": "standalone"
    }
binaryData:
  favicon.ico: 
  favicon-96x96.png: 
  web-app-manifest-192x192.png: 
  web-app-manifest-512x512.png: 
  apple-touch-icon.png: 
